const style = {display:'inline-block', whidth:'25%'}

const Skills2 =()=>(
        <div className="App">
        <ul style={{width:'100%'}}>
        <Link to={'/Information'} style={style}><li>Información Personal</li></Link>
<Link to={'/Resume'} style={style}><li>Resumen Ejecutivo </li></Link>
<Link to={'/Education'} style={style}><li>Educación</li></Link>
